import React from 'react';

function NavigationItems() {

    return (
        <ul className="navigation_items">
            <li><i class="lni lni-home lni-32 nav_icons"></i></li>
            <li><i class="lni lni-user lni-32 nav_icons"></i></li>
            <li><i class="lni lni-graduation lni-32 nav_icons"></i></li>
            <li><i class="lni lni-briefcase lni-32 nav_icons"></i></li>
            <li><i class="lni lni-envelope lni-32 nav_icons"></i></li>
        </ul>   
      );
}

export default NavigationItems;
